The Effect monad provides a well-typed API for computations with side-effects, while at the same time generating efficient JavaScript. Let's take a closer look at the return type of the familiar log function. Effect indicates that this function produces a native effect, console IO in this case. Unit indicates that no meaningful data is returned. You can think of Unit as being analogous to the void keyword in other languages, such as C, Java, etc. log :: String -> Effect Unit Aside: You may encounter IDE suggestions for the more general (and more elaborately typed) log function from Effect.Class.Console. This is interchangeable with the one from Effect.Console when dealing with the basic Effect monad. Reasons for the more general version will become clearer after reading about "Monad Transformers" in the "Monadic Adventures" chapter. For the curious (and impatient), this works because there's a MonadEffect instance for Effect. log :: forall m. MonadEffect m => String -> m Unit Now let's consider an Effect that returns meaningful data. The random function from Effect.Random produces a random Number. random :: Effect Number Here's a full example program (found in test/Random.purs of this chapter's exercises folder). module Test.Random where import Prelude
import Effect (Effect)
import Effect.Random (random)
import Effect.Console (logShow) main :: Effect Unit
main = do n <- random logShow n Because Effect is a monad, we use do notation to unwrap the data it contains before passing this data on to the effectful logShow function. As a refresher, here's the equivalent code written using the bind operator: main :: Effect Unit
main = random >>= logShow Try running this yourself with: spago run --main Test.Random You should see a randomly chosen number between 0.0 and 1.0 printed to the console. Aside: spago run defaults to searching in the Main module for a main function. You may also specify an alternate module as an entry point with the --main flag, as is done in the above example. Just be sure that this alternate module also contains a main function. Note that it's also possible to generate "random" (technically pseudorandom) data without resorting to impure effectful code. We'll cover these techniques in the "Generative Testing" chapter. As mentioned previously, the Effect monad is of central importance to PureScript. The reason why it's central is because it is the conventional way to interoperate with PureScript's Foreign Function Interface, which provides the mechanism to execute a program and perform side effects. While it's desireable to avoid using the Foreign Function Interface, it's fairly critical to understand how it works and how to use it, so I recommend reading that chapter before doing any serious PureScript work. That said, the Effect monad is fairly simple. It has a few helper functions, but aside from that it doesn't do much except encapsulate side effects.

