There is another effect defined in the core libraries: the ST effect. The ST effect is used to manipulate mutable state. As pure functional programmers, we know that shared mutable state can be problematic. However, the ST effect uses the type system to restrict sharing in such a way that only safe local mutation is allowed. The ST effect is defined in the Control.Monad.ST module. To see how it works, we need to look at the types of its actions: new :: forall a r. a -> ST r (STRef r a) read :: forall a r. STRef r a -> ST r a write :: forall a r. a -> STRef r a -> ST r a modify :: forall r a. (a -> a) -> STRef r a -> ST r a new is used to create a new mutable reference cell of type STRef r a, which can be read using the read action, and modified using the write and modify actions. The type a is the type of the value stored in the cell, and the type r is used to indicate a memory region (or heap ) in the type system. Here is an example. Suppose we want to simulate the movement of a particle falling under gravity by iterating a simple update function over a large number of small time steps. We can do this by creating a mutable reference cell to hold the position and velocity of the particle, and then using a for loop to update the value stored in that cell: import Prelude import Control.Monad.ST.Ref (modify, new, read)
import Control.Monad.ST (ST, for, run) simulate :: forall r. Number -> Number -> Int -> ST r Number
simulate x0 v0 time = do ref <- new { x: x0, v: v0 } for 0 (time * 1000) \_ -> modify ( \o -> { v: o.v - 9.81 * 0.001 , x: o.x + o.v * 0.001 } ) ref final <- read ref pure final.x At the end of the computation, we read the final value of the reference cell, and return the position of the particle. Note that even though this function uses mutable state, it is still a pure function, so long as the reference cell ref is not allowed to be used by other parts of the program. We will see that this is exactly what the ST effect disallows. To run a computation with the ST effect, we have to use the run function: run :: forall a. (forall r. ST r a) -> a The thing to notice here is that the region type r is quantified inside the parentheses on the left of the function arrow. That means that whatever action we pass to run has to work with any region r whatsoever. However, once a reference cell has been created by new, its region type is already fixed, so it would be a type error to try to use the reference cell outside the code delimited by run. This is what allows run to safely remove the ST effect, and turn simulate into a pure function! simulate' :: Number -> Number -> Int -> Number
simulate' x0 v0 time = run (simulate x0 v0 time) You can even try running this function in PSCi: > import Main > simulate' 100.0 0.0 0
100.00 > simulate' 100.0 0.0 1
95.10 > simulate' 100.0 0.0 2
80.39 > simulate' 100.0 0.0 3
55.87 > simulate' 100.0 0.0 4
21.54 In fact, if we inline the definition of simulate at the call to run, as follows: simulate :: Number -> Number -> Int -> Number
simulate x0 v0 time = run do ref <- new { x: x0, v: v0 } for 0 (time * 1000) \_ -> modify ( \o -> { v: o.v - 9.81 * 0.001 , x: o.x + o.v * 0.001 } ) ref final <- read ref pure final.x then the compiler will notice that the reference cell is not allowed to escape its scope, and can safely turn ref into a var. Here is the generated JavaScript for simulate inlined with run: var simulate = function (x0) { return function (v0) { return function (time) { return (function __do() { var ref = { value: { x: x0, v: v0 } }; Control_Monad_ST_Internal["for"](0)(time * 1000 | 0)(function (v) { return Control_Monad_ST_Internal.modify(function (o) { return { v: o.v - 9.81 * 1.0e-3, x: o.x + o.v * 1.0e-3 }; })(ref); })(); return ref.value.x; })(); }; };
}; Note that this resulting JavaScript is not as optimal as it could be. See this issue for more details. The above snippet should be updated once that issue is resolved. For comparison, this is the generated JavaScript of the non-inlined form: var simulate = function (x0) { return function (v0) { return function (time) { return function __do() { var ref = Control_Monad_ST_Internal["new"]({ x: x0, v: v0 })(); Control_Monad_ST_Internal["for"](0)(time * 1000 | 0)(function (v) { return Control_Monad_ST_Internal.modify(function (o) { return { v: o.v - 9.81 * 1.0e-3, x: o.x + o.v * 1.0e-3 }; })(ref); })(); var $$final = Control_Monad_ST_Internal.read(ref)(); return $$final.x; }; }; };
}; The ST effect is a good way to generate short JavaScript when working with locally-scoped mutable state, especially when used together with actions like for, foreach, and while which generate efficient loops.

