A convenient way to work with asynchronous code in JavaScript is with async and await . See this article on asynchronous JavaScript for more background information. Here is an example of using this technique to copy the contents of one file to another file: var fsPromises = require('fs').promises; async function copyFile(file1, file2) { let data = await fsPromises.readFile(file1, { encoding: 'utf-8' }); fsPromises.writeFile(file2, data, { encoding: 'utf-8' });
} copyFile('file1.txt', 'file2.txt')
.catch(e => { console.log('There was a problem with copyFile: ' + e.message);
}); It is also possible to use callbacks or synchronous functions, but those are less desireable because: Callbacks lead to excessive nesting, known as "Callback Hell" or the "Pyramid of Doom". Synchronous functions block execution of the other code in your app.

