We've seen how to use the Aff monad and do notation to compose asynchronous computations in sequence. It would also be useful to be able to compose asynchronous computations in parallel . With Aff, we can compute in parallel simply by initiating our two computations one after the other. The parallel package defines a type class Parallel for monads like Aff which support parallel execution. When we met applicative functors earlier in the book, we observed how applicative functors can be useful for combining parallel computations. In fact, an instance for Parallel defines a correspondence between a monad m (such as Aff) and an applicative functor f which can be used to combine computations in parallel: class (Monad m, Applicative f) <= Parallel f m | m -> f, f -> m where sequential :: forall a. f a -> m a parallel :: forall a. m a -> f a The class defines two functions: parallel, which takes computations in the monad m and turns them into computations in the applicative functor f, and sequential, which performs a conversion in the opposite direction. The aff library provides a Parallel instance for the Aff monad. It uses mutable references to combine Aff actions in parallel, by keeping track of which of the two continuations has been called. When both results have been returned, we can compute the final result and pass it to the main continuation. Because applicative functors support lifting of functions of arbitrary arity, we can perform more computations in parallel by using the applicative combinators. We can also benefit from all of the standard library functions which work with applicative functors, such as traverse and sequence! We can also combine parallel computations with sequential portions of code, by using applicative combinators in a do notation block, or vice versa, using parallel and sequential to change type constructors where appropriate. To demonstrate the difference between sequential and parallel execution, we'll create an array of 100 10-millisecond delays, then execute those delays with both techniques. You'll notice in the repl that seqDelay is much slower than parDelay. Note that parallel execution is enabled by simply replacing sequence_ with parSequence_. import Prelude import Control.Parallel (parSequence_)
import Data.Array (replicate)
import Data.Foldable (sequence_)
import Effect (Effect)
import Effect.Aff (Aff, Milliseconds(..), delay, launchAff_) delayArray :: Array (Aff Unit)
delayArray = replicate 100 $ delay $ Milliseconds 10.0 seqDelay :: Effect Unit
seqDelay = launchAff_ $ sequence_ delayArray parDelay :: Effect Unit
parDelay = launchAff_ $ parSequence_ delayArray $ spago repl > import Test.ParallelDelay > seqDelay -- This is slow
unit > parDelay -- This is fast
unit Here's a more real-world example of making multiple HTTP requests in parallel. We're reusing our getUrl function to fetch information from two users in parallel. Note that parTraverse (the parallel version of traverse) is used in this case. This example would also work fine with traverse instead, but it will be slower. import Prelude import Control.Parallel (parTraverse)
import Effect (Effect)
import Effect.Aff (launchAff_)
import Effect.Class.Console (logShow)
import Test.HTTP (getUrl) fetchPar :: Effect Unit
fetchPar = launchAff_ do let urls = map (\n -> "https://reqres.in/api/users/" <> show n) [ 1, 2 ] res <- parTraverse getUrl urls logShow res $ spago repl > import Test.ParallelFetch > fetchPar
unit
["{\"data\":{\"id\":1,\"email\":\"george.bluth@reqres.in\", ... }"
,"{\"data\":{\"id\":2,\"email\":\"janet.weaver@reqres.in\", ... }"
] A full listing of available parallel functions can be found in the parallel docs on Pursuit . The aff docs section on parallel also contains more examples.

