PureScript's curried functions has certain advantages. It allows us to partially apply functions, and to give type class instances for function types - but it comes with a performance penalty. For performance critical code, it is sometimes necessary to define uncurried JavaScript functions which accept multiple arguments. We can also create uncurried functions from PureScript. For a function of two arguments, we can use the mkFn2 function. uncurriedAdd :: Fn2 Int Int Int
uncurriedAdd = mkFn2 \n m -> m + n We can apply the uncurried function of two arguments by using runFn2 as before: uncurriedSum :: Int
uncurriedSum = runFn2 uncurriedAdd 3 10 The key here is that the compiler inlines the mkFn2 and runFn2 functions whenever they are fully applied. The result is that the generated code is very compact: var uncurriedAdd = function (n, m) { return m + n | 0;
}; var uncurriedSum = uncurriedAdd(3, 10); For contrast, here is a traditional curried function: curriedAdd :: Int -> Int -> Int
curriedAdd n m = m + n curriedSum :: Int
curriedSum = curriedAdd 3 10 and the resulting generated code, which is less compact due to the nested functions: var curriedAdd = function (n) { return function (m) { return m + n | 0; };
}; var curriedSum = curriedAdd(3)(10);

