We have seen examples of how to send and receive types with a native JavaScript representation, such as String, Number, Array, and Record, over FFI. Now we'll cover how to use some of the other types available in PureScript, like Maybe. Suppose we wanted to recreate the head function on arrays by using a foreign declaration. In JavaScript, we might write the function as follows: exports.head = arr => arr[0]; How would we type this function? We might try to give it the type forall a. Array a -> a, but for empty arrays, this function returns undefined. Therefore, the type forall a. Array a -> a does not correctly represent this implementation. We instead want to return a Maybe value to handle this corner case: foreign import maybeHead :: forall a. Array a -> Maybe a But how do we return a Maybe? It is tempting to write the following: // Don't do this let Data_Maybe = require("../Data.Maybe") exports.maybeHead = arr => { if (arr.length) { return Data_Maybe.Just.create(arr[0]); } else { return Data_Maybe.Nothing.value; }
} Importing and using the Data.Maybe module directly in the foreign module isn't recommended as it makes our code brittle to changes in the code generator — create and value are not public APIs. Additionally, doing this can cause problems when using purs bundle for dead code elimination. The recommended approach is to add extra parameters to our FFI-defined function to accept the functions we need. exports.maybeHeadImpl = just => nothing => arr => { if (arr.length) { return just(arr[0]); } else { return nothing; }
}; foreign import maybeHeadImpl :: forall a. (forall x. x -> Maybe x) -> (forall x. Maybe x) -> Array a -> Maybe a maybeHead :: forall a. Array a -> Maybe a
maybeHead arr = maybeHeadImpl Just Nothing arr Note that we wrote: forall a. (forall x. x -> Maybe x) -> (forall x. Maybe x) -> Array a -> Maybe a and not: forall a. ( a -> Maybe a) -> Maybe a -> Array a -> Maybe a While both forms work, the latter is more vulnerable to unwanted inputs in place of Just and Nothing. For example, in the more vulnerable case we could call it as follows: maybeHeadImpl (\_ -> Just 1000) (Just 1000) [1,2,3] which returns Just 1000 for any array input. This vulnerability is allowed because (\_ -> Just 1000) and Just 1000 match the signatures of (a -> Maybe a) and Maybe a respectively when a is Int (based on input array). In the more secure type signature, even when a is determined to be Int based on the input array, we still need to provide valid functions matching the signatures involving forall x. The only option for (forall x. Maybe x) is Nothing, since a Just value would assume a type for x and will no longer be valid for all x. The only options for (forall x. x -> Maybe x) are Just (our desired argument) and (\_ -> Nothing), which is the only remaining vulnerability.

