Functions with a type class constraint have an interesting representation at runtime. Because the behavior of the function might depend on the type class instance chosen by the compiler, the function is given an additional argument, called a type class dictionary , which contains the implementation of the type class functions provided by the chosen instance. For example, here is a simple PureScript function with a constrained type which uses the Show type class: shout :: forall a. Show a => a -> String
shout a = show a <> "!!!" The generated JavaScript looks like this: var shout = function (dict) { return function (a) { return show(dict)(a) + "!!!"; };
}; Notice that shout is compiled to a (curried) function of two arguments, not one. The first argument dict is the type class dictionary for the Show constraint. dict contains the implementation of the show function for the type a. We can call this function from JavaScript by passing an explicit type class dictionary from Data.Show as the first parameter: shout(require('Data.Show').showNumber)(42);

