Record patterns are used to match - you guessed it - records. Record patterns look just like record literals, but instead of values on the right of the colon, we specify a binder for each field. For example: this pattern matches any record which contains fields called first and last, and binds their values to the names x and y respectively: showPerson :: { first :: String, last :: String } -> String
showPerson { first: x, last: y } = y <> ", " <> x Record patterns provide a good example of an interesting feature of the PureScript type system: row polymorphism . Suppose we had defined showPerson without a type signature above. What would its inferred type have been? Interestingly, it is not the same as the type we gave: > showPerson { first: x, last: y } = y <> ", " <> x > :type showPerson
forall r. { first :: String, last :: String | r } -> String What is the type variable r here? Well, if we try showPerson in PSCi, we see something interesting: > showPerson { first: "Phil", last: "Freeman" }
"Freeman, Phil" > showPerson { first: "Phil", last: "Freeman", location: "Los Angeles" }
"Freeman, Phil" We are able to append additional fields to the record, and the showPerson function will still work. As long as the record contains the first and last fields of type String, the function application is well-typed. However, it is not valid to call showPerson with too few fields: > showPerson { first: "Phil" } Type of expression lacks required label "last" We can read the new type signature of showPerson as "takes any record with first and last fields which are Strings and any other fields , and returns a String". This function is polymorphic in the row r of record fields, hence the name row polymorphism . Note that this behavior is different than that of the original showPerson. Without the row variable r, showPerson only accepts records with exactly a first and last field and no others. Note that we could have also written > showPerson p = p.last <> ", " <> p.first and PSCi would have inferred the same type.

