Recall that the showPerson function matches a record inside its argument, binding the first and last fields to values named x and y. We could alternatively just reuse the field names themselves, and simplify this sort of pattern match as follows: showPersonV2 :: { first :: String, last :: String } -> String
showPersonV2 { first, last } = last <> ", " <> first Here, we only specify the names of the fields, and we do not need to specify the names of the values we want to introduce. This is called a record pun . It is also possible to use record puns to construct records. For example, if we have values named first and last in scope, we can construct a person record using { first, last }: unknownPerson :: { first :: String, last :: String }
unknownPerson = { first, last } where first = "Jane" last = "Doe" This may improve readability of code in some circumstances.
